                    <h6>+7(495)777-6-777<label class="text-muted mx-3">Для звонков из г.Москвы</label></h6>
                    <h6>8(800)2000-767<label class="text-muted mx-3">Бесплатный номер при звонке из любого города России</label></h6>
            </footer>
        </div> 
    )
}
